import React, { useState, useEffect } from "react";
import axios from "axios";

const Team = () => {
  const [team, setTeam] = useState(null);
  const [players, setPlayers] = useState([]);
  const [optimalTeam, setOptimalTeam] = useState([]);
  const [topPlayers, setTopPlayers] = useState(null);
  const [sortCriteria, setSortCriteria] = useState("total_points");
  const [selectedPosition, setSelectedPosition] = useState("");
  const [message, setMessage] = useState("");

  useEffect(() => {
    axios.get("/api/team?userId=1").then((response) => setTeam(response.data));
    axios.get("/api/players").then((response) => setPlayers(response.data));
    axios
      .get("/api/team/optimal_team")
      .then((response) => setOptimalTeam(response.data));
    axios
      .get("/api/team/top_players")
      .then((response) => setTopPlayers(response.data));
  }, []);

  const filteredPlayers = players
    .filter(
      (player) =>
        selectedPosition === "" ||
        player.position === parseInt(selectedPosition)
    )
    .sort((a, b) => b[sortCriteria] - a[sortCriteria]);

  const handleAddPlayer = () => {
    axios
      .post("/api/team?userId=1", { id: playerId })
      .then((response) => {
        setTeam(response.data);
        setMessage("Player added successfully!");
      })
      .catch(() => setMessage("There was an error adding the player!"));
  };

  const containerStyle = {
    display: "flex",
    justifyContent: "space-between",
    padding: "20px",
  };
  const leftColumnStyle = {
    width: "45%",
    borderRight: "1px solid #ddd",
    paddingRight: "20px",
  };
  const rightColumnStyle = { width: "45%", paddingLeft: "20px" };

  return (
    <div style={containerStyle}>
      <div style={leftColumnStyle}>
        <h2>Your Team</h2>
        {team ? (
          <div>
            <h3>{team.name}</h3>
            <p>Budget Remaining: ${team.budget}</p>
            <ul>
              {team.players.map((player) => (
                <li key={player.id}>{player.name}</li>
              ))}
            </ul>
          </div>
        ) : (
          <p>Loading team...</p>
        )}

        <h3>Sort and Filter Players</h3>
        <select
          value={selectedPosition}
          onChange={(e) => setSelectedPosition(e.target.value)}
        >
          <option value="">All Positions</option>
          <option value="1">Goalkeeper</option>
          <option value="2">Defender</option>
          <option value="3">Midfielder</option>
          <option value="4">Forward</option>
        </select>

        <select
          value={sortCriteria}
          onChange={(e) => setSortCriteria(e.target.value)}
        >
          <option value="total_points">Total Points</option>
          <option value="value">Value</option>
          <option value="goals_scored">Goals Scored</option>
          <option value="assists">Assists</option>
        </select>

        <ul>
          {filteredPlayers.map((player) => (
            <li key={player.id}>
              {player.name} - Points: {player.total_points}
            </li>
          ))}
        </ul>
        {message && <p>{message}</p>}
        <button onClick={handleAddPlayer}>Add Player</button>
      </div>

      <div style={rightColumnStyle}>
        <h3>Optimal Team (From Flask API)</h3>
        {optimalTeam.length > 0 ? (
          <ul>
            {optimalTeam.map((player, index) => (
              <li key={index}>
                {player.name} - {player.predicted_points}
              </li>
            ))}
          </ul>
        ) : (
          <p>Loading optimal team...</p>
        )}

        <h3>Highest predicted points next gameweek</h3>
        {topPlayers ? (
          <div>
            <p>Top Goalkeepers:</p>
            <ul>
              {topPlayers.GK &&
                topPlayers.GK.map((player, index) => (
                  <li key={index}>
                    {player.name} - {player.predicted_points}
                  </li>
                ))}
            </ul>
          </div>
        ) : (
          <p>Loading top players...</p>
        )}
      </div>
    </div>
  );
};

export default Team;
